-- creating database
create database healthcare;

-- use the database
use healthcare;

-- create tables
-- 1)patient table
create table aa(
Patient_ID integer auto_increment,
Fisrt_Name varchar(30),
Last_Name varchar(30),
Date_Of_Birth date,
Gender ENUM("MALE","FEMALE","OTHERS"),
Age int,
Blood_Group ENUM('A+', 'A-', 'B+', 'B-', 'AB+', 'AB-', 'O+', 'O-'),
Disease varchar(50),
Admission_Date date,
Status ENUM('Admitted', 'Discharged', 'In Treatment'),
primary key(Patient_ID)
);

-- insert values into patient table

-- select the records from table
select * from aa;

-- 2)doctors table
create table zz(
Doctor_ID integer auto_increment,
First_Name varchar(30),
Last_Name varchar(30),
Specialization varchar(30),
Phone_Number bigint,
Email varchar(100),
Address varchar(200),
Date_Of_Birth date,
Gender ENUM("MALE","FEMALE","OTHER"),
Join_Date date,
Is_Active BOOLEAN,
primary key(Doctor_ID)
);

-- insert values into doctor table

-- select the records from table  
select * from zz;

-- 3) create employees table
create table bbbb(
Employee_ID integer auto_increment,
First_Name varchar(30),
Last_Name varchar(30),
Date_Of_Birth date,
Gender ENUM("MALE","FEMALE","OTHERS"),
Job_Title varchar(30),
Department varchar(30),
Date_Hired date,
Salary decimal(10,2),
Phone_Number varchar(20),
Address varchar(200),
Shift ENUM("Day","Night"),
Status ENUM("Active","On Leave","Retired"),
LicenseNumber varchar(20),
EmploymentType ENUM("Full-Time","Part-Time"),
primary key(Employee_Id)
);

